import React, { useEffect, useState } from 'react';
import { fetchStudents } from '../api/adminApi'; // Ensure this matches your export

const StudentList = () => {
  // Stateful list of students
  const [students, setStudents] = useState([]);

  // Fetch students on component mount
  useEffect(() => {
    const getStudents = async () => {
      try {
        const response = await fetchStudents(); // Call the correct function
        setStudents(response);
      } catch (error) {
        console.error('Error fetching students:', error);
        alert('Error fetching students');
      }
    };
    getStudents();
  }, []); // Empty dependency array to fetch once on mount

  return (
    <div>
      <h2>Student List</h2>
      <ul>
        {students.map((student) => (
          <li key={student._id}>{student.name}</li> // Adjust key and name as needed
        ))}
      </ul>
    </div>
  );
};

export default StudentList;
